PREFIX pizza: <http://www.example.org/pizza#>

SELECT?pizza
WHERE {
 ?pizza a pizza:Pizza.
 ?pizza pizza:name "Peter Piper Pizza".
}

PREFIX office: <http://example.org/office#>

SELECT?officeHolder
WHERE {
 ?officeHolder office:hasDeputy?deputy.
  FILTER (?deputy = office:NeilBrown ||?deputy = office:AndrewPeacock)
}

